SELECT On_Time_On_Time_Performance_2016_1.DestAirportSeqID, On_Time_On_Time_Performance_2016_1.Div1Airport, ROW_NUMBER() OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.OriginCityName ORDER BY On_Time_On_Time_Performance_2016_1.Div1WheelsOff) AS win_2, SUM(On_Time_On_Time_Performance_2016_1.AirTime) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.SecurityDelay ORDER BY On_Time_On_Time_Performance_2016_1.Div1TotalGTime) AS win_3, AVG(On_Time_On_Time_Performance_2016_1.OriginWac) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.Div2AirportSeqID ORDER BY On_Time_On_Time_Performance_2016_1.ArrTime) AS win_4, AVG(On_Time_On_Time_Performance_2016_1.DepTime) OVER (PARTITION BY On_Time_On_Time_Performance_2016_1.DepTime ORDER BY On_Time_On_Time_Performance_2016_1.DepDelayMinutes) AS win_5 FROM On_Time_On_Time_Performance_2016_1 WHERE On_Time_On_Time_Performance_2016_1.AirlineID > 0